      &__list {
        @include flex;
        @include column;
        row-gap: 15px;
        &-item {
          a {
            @include link($color: white);
          }
        }
        @include desktop {
          flex-direction: row;

          column-gap: 30px;
        }
      }
    }

    &__social {
      @include flex;
      column-gap: 20px;
      &-item {
        img {
          object-fit: contain;
          max-width: 23px;
          max-height: 23px;
        }
      }
    }

    &__social-link {
    }
  }
}

